@pharrell on the red carpet at 2021 Met Gala was wearing an exclusive @richardmille RM 17-01 Tourbillon in 18k rose gold, full covered with baguette-cut diamonds. This watch is powered by a manual winding tourbillon movement with hours, minutes, power-reserve and function indicators. This edition has been unveiled in 2020 and produced in very few pieces. #RichardMille

Retail price: $ 1,304,500.00

Photo: @gettyimages | @richardmille

@danielricciardo of McLaren wins the F1 Grand Prix of Italy and on the podium celebrated wearing his not-for-sale @richardmille RM 67-02 Automatic made with his team’s colors. The bridges of the skeleton dial are colored in orange with matching orange rubber strap. The case is made of black quartz and carbon TPT, weighting  just 32 grams and the total bezel/caseband/caseback assembly has a slimness of 7.8mm, making the watch really comfortable on wrist. #RichardMille

Retail price: NFS

Photo : @f1 | @richardmille

@kimpembe3 of Paris Saint-Germain wears his piece-unique GMT Master II ‘Batman’ made by @skeletonconceptofficial. The footballer participated in the creating process of this insane timepiece with the Skeleton Concept’s team of master watchmakers. The GMT Master II has been entirely redesigned to give it a sportswear character that would match the personality of Kimpembe. #SkeletonConcept

Retail price: $ 55,560.00

Photo: @skeletonconceptofficial
